import React from 'react';
import './App.css';
import { Route, Routes , Navigate} from 'react-router-dom';
import AuthContextProvider from './context/AuthContext';
import Account from './pages/Account';
import Home from './pages/Home';
import Signin from './pages/Signin';
import Spanish from "./components/Spanish";
import French from "./components/French";
import Portuguese from "./components/Portuguese";
import Navbar from "./components/Navbar";
import Footer from "./components/footer";

function App() {
    return (
        <div>
            <AuthContextProvider>
                <Navbar />
                <Routes>
                    <Route path='/' element={<Signin />} />
                    <Route path='/home' element={<Protected><Home /></Protected>} />
                    <Route path="/spanish" element={<Protected><Spanish /></Protected>} />
                    <Route path="/french" element={<Protected><French /></Protected>} />
                    <Route path="/portuguese" element={<Protected><Portuguese /></Protected>} />
                    <Route path='/account' element={<Protected><Account /></Protected>} />
                    <Route path='*' element={<Navigate to='/' />} />
                </Routes>
            </AuthContextProvider>
            <Footer />
        </div>
    );
}
